import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        {
          name: 'Luna',
          id: '12e1231e'
        },
        {
          name: 'Saba',
          id: '12e1131e'
        },
        {
          name: 'Anna',

        },
        {
          name: 'Andrei'
        }
      ]
    }
  }
  render() {
    return <div className="App">
    {
      this.state.monsters.map((monster) => {
        return <h1 key={monster.name}>{monster.name}</h1>
      })
    }
    </div>;
  }
}

export default App;
